[[ASSOCIATE]] [[INHERITANCE]] [[SHARED_BEHAVIOR]] [[SAFEOBJECT]] [[NONE_OBJECT_SAFE]] [[BUILT_IN]] [[BUILTIN-TRAIT]] We can use traits to define shared behavior in an abstract way. We can use trait bounds to specify that a generic type can be any type that has certain behavior. Traits are similar to a feature often called interfaces in other languages, although with some differences. What is a trait? A trait is a language feature that is analogous to an interface, protocol, or contract. If you have a background in object-oriented programming, consider a trait to be an abstract base class. If you have a background in functional programming, Rust’s traits are close to Haskell’s type classes. these also support a form of inheritance that’s common in most object oriented languages. For now, though, the thing to remember is that traits represent common behavior (Or reusable codes like println!)that types opt into via the syntax impl Trait for Type. Traits are private by default. Traits are not usable by themselves and are meant to be implemented by types. Traits have the power to establish relationships between distinct types . They are the backbone to many language features such as closures, operators, smart pointers, loops, compile-time [[data_race]] checks, and much more. After the method signature, instead of providing an implementation within curly brackets, we use a semicolon This interface consists of associated items, which come in three varieties: Functions Types Constants What does [[PartialEq]] do for types? It enables comparisons with the == operator. “Partial” allows for cases where two values that match exactly should not be treated as equal, such as the floating point’s NAN value or SQL’s NULL. When you see a sentence with the following structure, “...T is Debug...”, what they’re saying is that T implements the Debug trait. All traits define an implicit type parameter Self that refers to "the type that is implementing this interface" Trait functions may omit the function body by replacing it with a semicolon. This indicates that the implementation must define the function. If the trait function defines a body, this definition acts as a default for any implementation which does not override it. Similarly, associated constants may omit the equals sign and expression to indicate implementations must define the constant value. Associated types must never define the type, the type may only be specified in an implementation. we mentioned that to use traits as trait objects , we must put them behind a pointer , such as &dyn Trait or Box (Rc would work too). Example: impl i32 { fn double(&self) -> Self { self * 2 }
